import axios from 'axios'

const getData = async (searchQuery, locationQuery) => {
    const res = await axios.get(`https://cors-anywhere.herokuapp.com/https://jobs.github.com/positions.json?description=${searchQuery}&location=${locationQuery}`)
    return {
        data: res.data
    }
}

export default getData
